  \"2016-07-27T22:23:49.396463\",\n\t\"name\": \"lake-umbagog-national-wildlife-refuge-comprehensive-conservation-plan-and-environmental-im\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Umbagog NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Umbagog NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, alternatives considered, the affected environment, environmental consequences,
  and consultation with others. Key planning issues include: wetland management, upland
  management, public use, furbearers, recreational uses, public use, and administration.\",\n\t\"license_title\":
